import { Link, useNavigate } from "react-router-dom";
import { useState } from "react";
import axios from "axios";
import styles from "./styles.module.css";

function Signup() {
	const navigate = useNavigate();
	const [formData, setFormData] = useState({
		username: "",
		email: "",
		password: ""
	});

	const handleChange = (e) => {
		setFormData({
			...formData,
			[e.target.name]: e.target.value
		});
	};

	const handleSubmit = async (e) => {
		e.preventDefault();
		try {
			// Add your regular signup API call here
			console.log("Signup data:", formData);
			// After successful signup, navigate to home page
			navigate("/");
		} catch (error) {
			console.error("Signup error:", error);
		}
	};

	const googleAuth = () => {
		window.location.href = "http://localhost:5000/auth/google";
	};

	return (
		<div className={styles.container}>
			<h1 className={styles.heading}>Sign up Form</h1>
			<div className={styles.form_container}>
				<div className={styles.left}>
					<img className={styles.img} src="./images/signup.jpg" alt="signup" />
				</div>
				<div className={styles.right}>
					<h2 className={styles.from_heading}>Create Account</h2>
					<input type="text" className={styles.input} placeholder="Username" name="username" value={formData.username} onChange={handleChange} />
					<input type="text" className={styles.input} placeholder="Email" name="email" value={formData.email} onChange={handleChange} />
					<input type="password" className={styles.input} placeholder="Password" name="password" value={formData.password} onChange={handleChange} />
					<button className={styles.btn} onClick={handleSubmit}>Sign Up</button>
					<p className={styles.text}>or</p>
					<button className={styles.google_btn} onClick={googleAuth}>
						<img src="./images/google.png" alt="google icon" />
						<span>Sing up with Google</span>
					</button>
					<p className={styles.text}>
						Already Have Account ? <Link to="/login">Log In</Link>
					</p>
				</div>
			</div>
		</div>
	);
}

export default Signup;
